import React from 'react';
import style from './Loader.module.less';

export default function Loader({ className }) {
  return (
    <div className={className ? `${style.Loader} ${className}` : style.Loader}>
      <div className={style['lds-ellipsis']}>
        <div></div>
        <div></div>
        <div></div>
        <div></div>
      </div>
    </div>
  );
}
